import React, {Component} from 'react'
import "./contact.css"



class Contact extends React.Component {
    render () {
        return (

            <div className="container">
                <h1>Contact</h1>
                <h3>Email: kecoston@gmail.com</h3>
                <h3><a href="https://www.linkedin.com/in/costonkatie/">Linkedin: kecoston</a></h3>
                <h3><a href="https://github.com/kecoston">Github: kecoston</a></h3>
            </div>


        )
    }
}

export default Contact
